import React from "react";
import Tilt from 'react-parallax-tilt';
import Face from  './Face.png';
import './Logo.css'

const Logo = () => {
    if (isSignedIn) {
        return (
            <div>
            <nav className="ma4 mt0">
                <Tilt className="Tilt br2 shadow-2" style={{ height: 50, width: 50 }}>
                <div><img alt="logo" src={Face}/></div>
                </Tilt>
            </nav>
            <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={onRouteChange('signout')} className='f3 link dim black pa3 pointer'>Logout</p>
            </nav>
            </div>
            
        );
    } else {
        return (
            <div>
                <nav className="ma4 mt0">
                    <Tilt className="Tilt br2 shadow-2" style={{ height: 50, width: 50 }}>
                    <div><img alt="logo" src={Face}/></div>
                    </Tilt>
                </nav>
                <nav style={{display: 'flex', justifyContent: 'flex-end'}}>
                <p onClick={onRouteChange('signin')} className='f3 link dim black pa3 pointer'>Login</p>
                <p onClick={onRouteChange('register')} className='f3 link dim black pa3 pointer'>Register</p>
                </nav>
            </div>
        );
    }
}

export default Logo;
